import React, { useState } from "react";
import { Link, Route } from "react-router-dom";
import Signup from "./Signup";
import Signin from "./Signin";

function Landing() {
  const [showSignup, setShowSignup] = useState(true);

  const toggleSignup = () => {
    setShowSignup(!showSignup);
  };

  return (
    <div className="landing">
      <div className="landingspace">
        <div>
          {showSignup ? <Signup /> : <Signin />}
          <p>
            {showSignup ? "Already have an account? " : "Don't have an account? "}
            <button onClick={toggleSignup}>
              {showSignup ? "Sign In" : "Sign Up"}
            </button>
          </p>
        </div>
        <div>
          <h1>Content Area</h1>
          <Route exact path="/about">
            <p>Content for the About page</p>
          </Route>
          <Route exact path="/features">
            <p>Content for the Features page</p>
          </Route>
          <Route exact path="/safety">
            <p>Content for the Safety page</p>
          </Route>
          <Route exact path="/compatibility">
            <p>Content for the Compatibility page</p>
          </Route>
        </div>
      </div>
    </div>
  );
}

export default Landing;
